// src/api/vacantesService.js
import api from './api';

const vacantesService = {
  // ===============================
  // VACANTES
  // ===============================
  
  // Obtener todas las vacantes activas
  async getVacantesActivas() {
    try {
      const response = await api.get('/api/vacantes');
      return response.data;
    } catch (error) {
      console.error('Error al obtener vacantes:', error);
      throw error;
    }
  },

  // Crear nueva vacante
  async crearVacante(vacante) {
    try {
      const response = await api.post('/api/vacantes', vacante);
      return response.data;
    } catch (error) {
      console.error('Error al crear vacante:', error);
      throw error;
    }
  },

  // Buscar vacantes con filtros
  async buscarVacantes(filtros) {
    try {
      const params = new URLSearchParams();
      Object.keys(filtros).forEach(key => {
        if (filtros[key] !== '' && filtros[key] !== null && filtros[key] !== undefined) {
          params.append(key, filtros[key]);
        }
      });
      
      const response = await api.get(`/api/vacantes/buscar?${params.toString()}`);
      return response.data;
    } catch (error) {
      console.error('Error al buscar vacantes:', error);
      throw error;
    }
  },

  // ===============================
  // SOLICITUDES
  // ===============================
  
  // Obtener solicitudes
  async getSolicitudes(usuarioID, rol) {
    try {
      const params = new URLSearchParams();
      if (usuarioID) params.append('usuarioID', usuarioID);
      if (rol) params.append('rol', rol);
      
      const response = await api.get(`/api/vacantes/solicitudes?${params.toString()}`);
      return response.data;
    } catch (error) {
      console.error('Error al obtener solicitudes:', error);
      throw error;
    }
  },

  // Crear nueva solicitud
  async crearSolicitud(solicitud) {
    try {
      const response = await api.post('/api/vacantes/solicitudes', solicitud);
      return response.data;
    } catch (error) {
      console.error('Error al crear solicitud:', error);
      throw error;
    }
  },

  // Aprobar solicitud
  async aprobarSolicitud(solicitudId, comentarios = '') {
    try {
      const response = await api.put(`/api/vacantes/solicitudes/${solicitudId}/aprobar`, {
        comentarios
      });
      return response.data;
    } catch (error) {
      console.error('Error al aprobar solicitud:', error);
      throw error;
    }
  },

  // Rechazar solicitud
  async rechazarSolicitud(solicitudId, comentarios = '') {
    try {
      const response = await api.put(`/api/vacantes/solicitudes/${solicitudId}/rechazar`, {
        comentarios
      });
      return response.data;
    } catch (error) {
      console.error('Error al rechazar solicitud:', error);
      throw error;
    }
  },

  // ===============================
  // POSTULACIONES
  // ===============================
  
  // Obtener postulaciones
  async getPostulaciones(usuarioID, rol) {
    try {
      const params = new URLSearchParams();
      if (usuarioID) params.append('usuarioID', usuarioID);
      if (rol) params.append('rol', rol);
      
      const response = await api.get(`/api/vacantes/postulaciones?${params.toString()}`);
      return response.data;
    } catch (error) {
      console.error('Error al obtener postulaciones:', error);
      throw error;
    }
  },

  // Crear nueva postulación
  async crearPostulacion(postulacion) {
    try {
      const response = await api.post('/api/vacantes/postulaciones', postulacion);
      return response.data;
    } catch (error) {
      console.error('Error al crear postulación:', error);
      throw error;
    }
  },

  // Cambiar estado de postulación
  async cambiarEstadoPostulacion(postulacionId, estado, comentarios = '') {
    try {
      const response = await api.put(`/api/vacantes/postulaciones/${postulacionId}/estado`, {
        estado,
        comentarios
      });
      return response.data;
    } catch (error) {
      console.error('Error al cambiar estado de postulación:', error);
      throw error;
    }
  },

  // ===============================
  // ESTADÍSTICAS Y REPORTES
  // ===============================
  
  // Obtener estadísticas del dashboard
  async getEstadisticas() {
    try {
      const response = await api.get('/api/vacantes/estadisticas');
      return response.data;
    } catch (error) {
      console.error('Error al obtener estadísticas:', error);
      throw error;
    }
  },

  // Obtener resumen para reportes
  async getReportesResumen() {
    try {
      const response = await api.get('/api/vacantes/reportes/resumen');
      return response.data;
    } catch (error) {
      console.error('Error al obtener resumen de reportes:', error);
      throw error;
    }
  },

  // Exportar reporte
  async exportarReporte(formato, tipo) {
    try {
      const response = await api.post('/api/vacantes/reportes/exportar', {
        formato,
        tipo
      });
      return response.data;
    } catch (error) {
      console.error('Error al exportar reporte:', error);
      throw error;
    }
  },

  // ===============================
  // DATOS AUXILIARES
  // ===============================
  
  // Obtener departamentos
  async getDepartamentos() {
    try {
      const response = await api.get('/api/vacantes/departamentos');
      return response.data;
    } catch (error) {
      console.error('Error al obtener departamentos:', error);
      throw error;
    }
  },

  // Obtener usuarios/empleados
  async getUsuarios() {
    try {
      const response = await api.get('/api/vacantes/usuarios');
      return response.data;
    } catch (error) {
      console.error('Error al obtener usuarios:', error);
      throw error;
    }
  }
};

export default vacantesService;
